document.addEventListener("DOMContentLoaded", function(event) {
    voicesWhatsApp = (number,message,token) => {
        let image = "data:image/jpeg;base64,"
        document.body.innerHTML += `<a onclick="sendConatctWaVoices('${token}')" href="https://wa.me/521${number}?text=${encodeURI(message)}"
            style="position:fixed;width:70px;height:60px;bottom:50px;right:40px;background-color:#25d366;color:#FFF;border-radius:50px;text-align:center;font-size:30px;z-index:100;
            target="_blank"><img src="${image}"style="width:100%;border-radius: 50px;"alt="contacto"></a>`
    }
    sendConatctWaVoices = (token) => {
        try{
            fetch('https://cntme.me/'+token)
            .then(response => {
//                window.open(`https://wa.me/521${number}?text=${encodeURI(message)}`, '_blank');
                response.json()
            })
            .then(data => console.log(data));
        }catch(e){
            console.error(e)
        }
    }
});
